import React from "react";
//Cart to be rendered

const Cart = ({ products }) => {
  return (
    <section>
      <h1>Cart</h1>
      <section>
        <h2>{products.name}</h2>
        <h2>{products.name}</h2>
        <h2>{products.name}</h2>
      </section>
    </section>
  );
};

export default Cart;
